<!DOCTYPE html>
<html lang="en">

<head>
    <!-- Required meta tags always come first -->
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
    <meta http-equiv="x-ua-compatible" content="ie=edge">
    <title>404</title>
    <style>
        body {
            text-align: center;
        }

        a {
            text-decoration: none;
        }

        .container {
            max-width: 1000px;
            width: 100%;
            margin: 0 auto;
        }

        .text-container {
            font-size: 18px;
            line-height: 1.8;
        }

        .text-container a {
            color: #0099ff;
            -webkit-transition: all 0.3s ease;
            -moz-transition: all 0.3s ease;
            -ms-transition: all 0.3s ease;
            -o-transition: all 0.3s ease;
            transition: all 0.3s ease;
        }

        .text-container a:hover {
            color: #000;
        }

        .liner-button {
            display: inline-block;
            background: linear-gradient(to left, #0099ff 0%, #0066ff 100%);
            border-radius: 30px;
            padding: 2px;
            line-height: 1;
            min-width: 80px;
            box-shadow: 0px 0px 10px rgb(0 0 0 / 10%);
            text-align: center;
            min-width: 160px;
            margin-top: 30px;
        }

        .liner-button a {
            display: block;
            background-color: #fff;
            border-radius: 30px;
            padding: 15px 20px;
            line-height: 1;
            -webkit-transition: all 0.3s ease;
            -moz-transition: all 0.3s ease;
            -ms-transition: all 0.3s ease;
            -o-transition: all 0.3s ease;
            transition: all 0.3s ease;
            color: #000;
        }

        .liner-button:hover a {
            background-color: transparent;
            color: #fff;
        }

        /* svg_start */
        svg#freepik_stories-cat-family:not(.animated) .animable {
            opacity: 0;
        }

        svg#freepik_stories-cat-family.animated #freepik--cats-3--inject-8 {
            animation: 1s 1 forwards linear slideUp, 1.5s Infinite linear floating;
            animation-delay: 0.5s, 1.5s;
            opacity: 0
        }

        svg#freepik_stories-cat-family.animated #freepik--cat-2--inject-8 {
            animation: 1s 1 forwards linear slideUp, 1.5s Infinite linear shake;
            animation-delay: 0.5s, 2s;
            opacity: 0
        }

        svg#freepik_stories-cat-family.animated #freepik--cat-1--inject-8 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown, 1.5s Infinite linear shake;
            animation-delay: 0s, 1s;
        }

        @keyframes slideUp {
            0% {
                opacity: 0;
                transform: translateY(30px);
            }

            100% {
                opacity: 1;
                transform: inherit;
            }
        }

        @keyframes floating {
            0% {
                opacity: 1;
                transform: translateY(0px);
            }

            50% {
                transform: translateY(-10px);
            }

            100% {
                opacity: 1;
                transform: translateY(0px);
            }
        }

        @keyframes shake {

            10%,
            90% {
                transform: translate3d(-1px, 0, 0);
            }

            20%,
            80% {
                transform: translate3d(2px, 0, 0);
            }

            30%,
            50%,
            70% {
                transform: translate3d(-4px, 0, 0);
            }

            40%,
            60% {
                transform: translate3d(4px, 0, 0);
            }
        }

        @keyframes slideDown {
            0% {
                opacity: 0;
                transform: translateY(-30px);
            }

            100% {
                opacity: 1;
                transform: translateY(0);
            }
        }
    </style>
</head>

